package TOP100题;

import java.util.*;

public class 有效的字母异位词 {
    public static void main(String[] args) {
//        String s = "";
//        String t = "";

        String s =  "rat";
        String t =  "car";
        System.out.println(isAnagram(s,t));
    }
    public static boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }

        Map<Character,Integer> sMap = new HashMap<>();
        Map<Character,Integer> tMap = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            if (sMap.containsKey(s.charAt(i))) {
                int sVal = sMap.get(s.charAt(i));
                sMap.put(s.charAt(i), sVal+1);
            } else {
                sMap.put(s.charAt(i), 1);
            }

            if (tMap.containsKey(t.charAt(i))) {
                int tVal = tMap.get(t.charAt(i));
                tMap.put(t.charAt(i), tVal+1);
            } else {
                tMap.put(t.charAt(i), 1);
            }
        }

        Set<Map.Entry<Character, Integer>> sSet = sMap.entrySet();

        for (Map.Entry<Character, Integer> ss:sSet) {
            //System.out.println("key sValue tValue:" + ss.getKey() + " " + ss.getValue() + " " + tMap.get(ss.getKey()));
            if (!tMap.containsKey(ss.getKey()) || ss.getValue() != (int)tMap.get(ss.getKey())) {
                System.out.println("False: key sValue tValue:" + ss.getKey() + " " + ss.getValue() + " " + tMap.get(ss.getKey()));
                return false;
            }
        }
        return true;
    }
}
